import React, { useEffect } from "react";

const Firstpage = (props) => {
  return (
    <header className="header">
      <div className="h1">
        <text style={{ margin: 20 }}>Home</text>
        <text>9th-10th</text>
        <text>11th-12th</text>
        <text>Undergraduate</text>
        <text>Study Abroad</text>
        <text>Blog</text>
      </div>
    </header>
  );
};

export default Firstpage;
